import React from 'react';
import styled from 'styled-components';

function LocationModal() {
	return (
		<ComponentWrapper>
			<div className="popup-location">
				<div className="modal-header">
					<button
						type="button"
						class="LocationsPopup_ResetButton__Ko46W"
					>
						<i class="icon-refresh"></i>초기화
					</button>
					<span>
						지역
						<span class="FilteredCount_filteredCount__3PCO5">
							1
						</span>
					</span>
				</div>
			</div>
			<div className="overlay-modal" />
		</ComponentWrapper>
	);
}

const ComponentWrapper = styled.div`
	top: 0;
	left: 0;
	right: 0;
	bottom: 0;
	position: fixed;
	overflow: hidden;
	z-index: 1400;
	.popup-location {
		max-height: 687px;
		min-height: 556px;
		top: 50%;
		left: 50%;
		width: 100%;
		max-width: 500px;
		transform: translate(-50%, -50%);
		z-index: 5;
		overflow-y: auto;
		border-radius: 5px;
		background-color: #fff;
		position: absolute;
		overflow: hidden;
	}
	.overlay-modal {
		position: fixed;
		left: 0;
		right: 0;
		top: 0;
		bottom: 0;
		z-index: 4;
		background-color: rgba(0, 0, 0, 0.5);
	}
`;

export default LocationModal;
